FIND A LOCAL FOR A TAILOR-MADE CITY TOUR
Where’s your next trip? With the Showaround app, you can book a local for a private tour whilst on-the-go and take traveling to a completely different level – meet locals from all around the world and discover the true beauty of any city from an insider’s perspective. Choose the perfect buddy to explore a new place with based on their personality, hobbies, or experience. 

ARRANGE ACTIVITIES 
Create your own personalised tour, plan activities in advance, and communicate with locals, all in one place. Skip the tourist traps and spend time visiting the sights that truly interest you - whether it’s an art gallery opening, sipping Champagne on a terrace somewhere, or just walking along the streets of an old town, Showaround locals will have you covered.

SIGN UP AS A LOCAL
Become a Showaround local, give tours in your city, and get a chance to meet students, backpackers, professionals and other travelers from every corner of the world. Share with them the best your city has to offer – and with flexible schedule, you can show people around as much as you like, whenever you like.

AS A TOURIST, YOU CAN:
• Automatically see the locals in the selected area;
• Filter locals according to your search criteria: languages, activities and more;
• When traveling, you can simply create a Trip for your next destination and receive offers from locals with suggestions for your visit.

AS A LOCAL, YOU CAN:
• Add photos to your travel profile;
• Specify the languages you can speak;
• Write a bit about yourself;
• Tell more about what kind of guided tours you’re offering, including activities such as nightlife, culture, food, etc.;
• See how many tourists are looking for a local buddy in your hometown;
• Send offers to visitors. 

